import {B64chromium} from "chromium-base64"
const b64 = new B64chromium();
var CONST = {
    WASM: undefined,
    BYTES: b64.base64ToBytes("")
}

function charCodeAt (c) {
    return c.charCodeAt(0)
}
function toUint8Array (s) {
    return new Uint8Array(atob(s).split('').map(charCodeAt));
}

let cachedTextDecoder = new TextDecoder('utf-8', { ignoreBOM: true, fatal: true });
cachedTextDecoder.decode();

let cachedUint8Memory0 = null;

function getUint8Memory0() {
    if (cachedUint8Memory0 === null || cachedUint8Memory0.byteLength === 0) {
        cachedUint8Memory0 = new Uint8Array(CONST.WASM.memory.buffer);
    }
    return cachedUint8Memory0;
}

function getStringFromWasm0(ptr, len) {
    ptr = ptr >>> 0;
    return cachedTextDecoder.decode(getUint8Memory0().subarray(ptr, ptr + len));
}

let WASM_VECTOR_LEN = 0;

function passArray8ToWasm0(arg, malloc) {
    const ptr = malloc(arg.length * 1, 1) >>> 0;
    getUint8Memory0().set(arg, ptr / 1);
    WASM_VECTOR_LEN = arg.length;
    return ptr;
}

let cachedInt32Memory0 = null;

function getInt32Memory0() {
    if (cachedInt32Memory0 === null || cachedInt32Memory0.byteLength === 0) {
        cachedInt32Memory0 = new Int32Array(CONST.WASM.memory.buffer);
    }
    return cachedInt32Memory0;
}

function getArrayU8FromWasm0(ptr, len) {
    ptr = ptr >>> 0;
    return getUint8Memory0().subarray(ptr / 1, ptr / 1 + len);
}
/**
 * @param {Uint8Array} data
 * @param {number} level
 * @param {boolean} interlace
 * @returns {Uint8Array}
 */
function optimise(data, level, interlace, optimize_alpha) {
    try {
        const retptr = CONST.WASM.__wbindgen_add_to_stack_pointer(-16);
        const ptr0 = passArray8ToWasm0(data, CONST.WASM.__wbindgen_malloc);
        const len0 = WASM_VECTOR_LEN;
        CONST.WASM.optimise(retptr, ptr0, len0, level, interlace, optimize_alpha);
        var r0 = getInt32Memory0()[retptr / 4 + 0];
        var r1 = getInt32Memory0()[retptr / 4 + 1];
        var v2 = getArrayU8FromWasm0(r0, r1).slice();
        CONST.WASM.__wbindgen_free(r0, r1 * 1);
        return v2;
    } finally {
        CONST.WASM.__wbindgen_add_to_stack_pointer(16);
    }
}

async function load(bytes, imports) {
    return await WebAssembly.instantiate(bytes, imports);
}

async function init(bytes) {

    if(typeof bytes != "undefined"){
        const imports = {};
        imports.wbg = {};
        imports.wbg.__wbindgen_throw = function (arg0, arg1) {
            throw new Error(getStringFromWasm0(arg0, arg1));
        };

        if(!init.__wbindgen_wasm_module){

            const {instance, module} = await load(bytes, imports);

            CONST.WASM = instance.exports;
            init.__wbindgen_wasm_module = module;
        }

        return CONST.WASM;
    }
}

function urltoblob (url) {
    return new Promise(function(resolve, reject){
        fetch(url).then(function(response){
            response.blob().then(function(blob){
                resolve(blob);
            }).catch(reject);
        }).catch(reject);
    });
}

const READER = new FileReader();
function blobToUrl(blob, useB64) {
    return new Promise((resolve, _) => {
        if(useB64) {
            READER.onloadend = () => resolve(READER.result);
            READER.readAsDataURL(blob);
        }else {
            resolve(URL.createObjectURL(blob))
        }
    });
}
init(CONST.BYTES);
export function oxi_png(dataurl, level = 0, interlace = false, useBlob = false) {

    return new Promise(function(resolve, reject){
        urltoblob(dataurl).then(function(blob){
            blob.arrayBuffer().then(function(array_buffer){
                resolve(
                    blobToUrl(new Blob(
                        optimise(
                            new Uint8Array(array_buffer),
                            level|0,
                            interlace|0,
                            1
                        )
                    ,{type: "image/png"}), !useBlob)
                );
            }).catch(reject);
        }).catch(reject);
    });
}